import React from "react";
import { Card, Button, CardTitle, Row, Col, Label } from "reactstrap";

import { store, actions } from "../../redux";

import * as S from "./styles";

export default function Application() {
  const [signedCourses, setSignedCourses] = React.useState([]);

  React.useEffect(() => {
    store.subscribe(() => {
      setSignedCourses(store.getState().applicationReducer.signedCourses);
    });

    store.dispatch(actions.getApplicationData());
  }, []);

  console.log(signedCourses);
  return (
    <S.Container className="container">
      <Row>
        <Col md="6">
          <S.Label>Name</S.Label>
          <S.UserData>Paulo Cesar</S.UserData>
        </Col>
        <Col md="6">
          <S.Label>Email</S.Label>
          <S.UserData>pcfmello@gmail.com</S.UserData>
        </Col>
      </Row>
      <S.Button color="danger">Logout</S.Button>
    </S.Container>
  );
}
